// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBaseV2.sol";
import "@chainlink/contracts/src/v0.8/ConfirmedOwner.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./AlwaysAlive.sol";

contract VRFConsumer is VRFConsumerBaseV2, ConfirmedOwner {
    mapping(uint256 => RequestStatus) public requests;
    VRFCoordinatorV2Interface COORDINATOR;

    uint64 subscriptionId;

    uint256[] public requestIds;
    uint256 public lastRequestId;

    bytes32 keyHash =
        0x4b09e658ed251bcafeebbc69400383d49f344ace09b9576fe248bb02c003fe9f;

    uint32 callbackGasLimit = 2_000_000;

    uint16 requestConfirmations = 3;

    uint32 numWords = 3;

    struct RequestStatus {
        bool fulfilled;
        bool exists;
        uint256[] randomWords;
    }

    bool activated = false;

    // Chainlink Events
    event RequestSent(uint256 requestId, uint32 numWords);
    event RequestFulfilled(uint256 requestId, uint256[] randomWords);

    constructor(uint64 _subscriptionId)
        VRFConsumerBaseV2(0x7a1BaC17Ccc5b313516C5E16fb24f7659aA5ebed)
        ConfirmedOwner(msg.sender)
    {
        COORDINATOR = VRFCoordinatorV2Interface(
            0x7a1BaC17Ccc5b313516C5E16fb24f7659aA5ebed
        );
        subscriptionId = _subscriptionId;
    }

    function requestRandomWords()
        external
        onlyOwner
        returns (uint256 requestId)
    {
        requestId = COORDINATOR.requestRandomWords(
            keyHash,
            subscriptionId,
            requestConfirmations,
            callbackGasLimit,
            numWords
        );
        requests[requestId] = RequestStatus({
            randomWords: new uint256[](0),
            exists: true,
            fulfilled: false
        });
        requestIds.push(requestId);
        lastRequestId = requestId;
        emit RequestSent(requestId, numWords);
        return requestId;
    }

    function fulfillRandomWords(
        uint256 _requestId,
        uint256[] memory _randomWords
    ) internal override {
        require(requests[_requestId].exists, "request not found");
        requests[_requestId].fulfilled = true;
        requests[_requestId].randomWords = _randomWords;
        emit RequestFulfilled(_requestId, _randomWords);

        // Section for paying random kin profit
    }

    function getRequestStatus(uint256 _requestId)
        external
        view
        returns (bool fulfilled, uint256[] memory randomWords)
    {
        require(requests[_requestId].exists, "request not found");
        RequestStatus memory request = requests[_requestId];
        return (request.fulfilled, request.randomWords);
    }
}

contracts/YieldAggregator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@aave/core-v3/contracts/interfaces/IPoolAddressesProvider.sol";
// import "@aave/core-v3/contracts/interfaces/IPool.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@aave/periphery-v3/contracts/misc/interfaces/IWrappedTokenGatewayV3.sol";

contract YieldAggregator {
    using SafeERC20 for IERC20;

    IERC20 aWETH = IERC20(0x685bF4eab23993E94b4CFb9383599c926B66cF57);

    IWrappedTokenGatewayV3 WETHGateWay =
        IWrappedTokenGatewayV3(0x2a58E9bbb5434FdA7FF78051a4B82cb0EF669C17);

    IPoolAddressesProvider poolAddressProvider =
        IPoolAddressesProvider(0x5343b5bA672Ae99d627A1C87866b8E53F47Db2E6);

    address public poolAddress = poolAddressProvider.getPool();
    // IPool pool = IPool(poolAddress);

    event suppliedMatic(address user, uint256 when);
    event withdrawnMatic(address user, uint256 when);

    function depositMatic(uint256 amount) public payable {
        WETHGateWay.depositETH{value: amount}(poolAddress, msg.sender, 0);
        emit suppliedMatic(msg.sender, block.timestamp);
    }

    function withdrawMatic(uint256 amount, address kin) public {
        IERC20(aWETH).safeApprove(address(aWETH), amount);
        WETHGateWay.withdrawETH(poolAddress, amount, kin);
        emit withdrawnMatic(kin, block.timestamp);
    }
}

